// Contacts.js
import React from 'react';
import Header from './Header';
import Info from './Info';
import Footer from './Footer';

const Contacts = () => {
    return (
        <div class="main-content">
            <Header />
            <Info />
            <Footer />
        </div>
    );
};

export default Contacts;
